    const {profile, getInfant, fill} = ServeiVistaInfant();

    useEffect(() => {
        getInfant();
    },[])


    return(
        <div>
        { fill ?
            <div className="container">
                <div className="row">
                    <div className="col">
                        <h1></h1>
                    </div>
                </div>
            </div> : <h1>Afegeix al teu fill</h1>
        }
        </div>
    )

}
